import React from 'react';
import './App.css';

import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import Navbar from './components/Navbar';
import Header from './components/Header';

function App() {
  return (
      <div className='mainbody'>
        <Navbar/>
        <Header/>
      </div>
  );
}

export default App;
